$(document).ready(function(){
	
	// width and height of visualization
	var w = 800, h = 1200;
	// range of old values X & Y in DB
	var old_x = [-1857.029674, 3915.577953];
	var old_y = [-2448.893887, 4420.778767];
	// range of new values X & Y for this display
	var new_x = [30, w - 30];
	var new_y = [30, h - 30];
	
	// The raphael object to draw to
	var infovis = Raphael(document.getElementById("infovis"), w, h);
	
	// Draw the lines
	$.each(lines, function(i, item){
		l = infovis.path("M"+change_range(item[0], old_x, new_x) +" "+ change_range(item[1], old_y, new_y) +" L" + change_range(item[2], old_x, new_x) +" "+ change_range(item[3], old_y, new_y))
		var line_color = "#C8E4E6";
		if(item[4] > 0.4){ line_color = "#E9C152" }
		if(item[4] > 0.55){ line_color = "#2E3377" }
		if(item[4] > 0.65){ line_color = "#C93850" }
		l.attr({
			"stroke": line_color,
			"stroke-width": item[4]
		})
	}) // End draw verticies
	
	// Loop through each item in JSON data
	$.each(data, function(i, item){
		// The indices of each "item" in the array are as follows:
		// [0=x, 1=y, 2=size, 3=name, 4=color, 5=leamer_name, 6=SITC4, 7=ExportAmount, 8=RCA]
		
		// Need to change the range to fit the particular dimensions of the page
		var size = Math.pow(change_range(item[2], [2.50242712, 8.693678594], [0, 3.25]), 2.25)
		var x = change_range(item[0], old_x, new_x);
		var y = change_range(item[1], old_y, new_y);
		
		var c = infovis.circle(x, y, size)
		// If the product's RCA is > 1 and it is exported by this country
		if(typeof item[6] != 'undefined' && item[8] >= 1){
			c.attr({
				"fill": item[4],
				"stroke": "#000000",
				"stroke-width": 2.5
			});
		}
		// Otherwise the product is not exported with RCA > 1
		// Draw as a circle with leamer color
		else {
			var color_hsb = Raphael.rgb2hsb(Raphael.getRGB(item[4]));
			var lighter_color = "hsl("+color_hsb["h"]+","+color_hsb["s"]+",0.96)";
			c.attr({
					"fill": lighter_color,
					"stroke-width": 0.5,
					"stroke": "#333333"
			});
		}
	});


})

</script>
